import ListGifs from "../components/ListGifs";

import {GifHook} from "../hooks/GifHook";


export default function SearchResults({params}){


    const {keyword}= params



    const {loading, gifos} = GifHook({keyword})




    return (
        <div>
            {loading?
            <h1>Loading</h1>
        :
       <><h1> {params.keyword}
        </h1><ListGifs gifs={gifos} /></>}
        </div>
    );
}
